import React, { useEffect, useState } from 'react';
import { getHumans, deleteHuman } from '../../services/api';
import { Link } from 'react-router-dom';

const HumansList = () => {
    const [humans, setHumans] = useState([]);

    useEffect(() => {
        fetchHumans();
    }, []);

    const fetchHumans = async () => {
        const response = await getHumans();
        setHumans(response.data);
    };

    const handleDelete = async (id) => {
        await deleteHuman(id);
        fetchHumans();
    };

    return (
        <div>
            <h1>Humans</h1>
            <Link to="/humans/new">Add Human</Link>
            <ul>
                {humans.map(human => (
                    <li key={human.id}>
                        {human.name}
                        <button onClick={() => handleDelete(human.id)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default HumansList;
